import React, { useState, useEffect } from 'react';
import axios from '../utils/axios'; // Use the centralized axios instance
import Card from '../components/Card';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { useNotification } from '../context/NotificationContext';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const DashboardPage = () => {
  const { showNotification } = useNotification();
  const [summary, setSummary] = useState({ totalIncome: 0, totalExpenses: 0, totalSavings: 0 });
  const [chartData, setChartData] = useState({ labels: [], datasets: [] });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDashboardData = async () => {
      setLoading(true);
      try {
        // Parallel API calls
        const [summaryRes, monthlySummaryRes, savingsRes] = await Promise.all([
          axios.get('/transactions/summary'),
          axios.get('/transactions/monthly-summary'),
          axios.get('/savings/summary') // Assuming a savings summary endpoint
        ]);

        const { totalIncome, totalExpenses } = summaryRes.data.data;
        const { labels, incomeData, expenseData } = monthlySummaryRes.data.data;
        const totalSavings = savingsRes.data.data.totalSavings || 0;

        setSummary({ totalIncome, totalExpenses, totalSavings });

        setChartData({
          labels,
          datasets: [
            { label: 'Income', data: incomeData, borderColor: '#16a34a', backgroundColor: 'rgba(22, 163, 74, 0.5)' },
            { label: 'Expenses', data: expenseData, borderColor: '#ef4444', backgroundColor: 'rgba(239, 68, 68, 0.5)' },
          ],
        });

      } catch (err) {
        console.error(err);
        showNotification('Failed to fetch dashboard data.', 'error');
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, [showNotification]);

  const totalBalance = summary.totalIncome - summary.totalExpenses;

  if (loading) {
    return <div className="text-center py-8">Loading dashboard...</div>;
  }

  return (
    <div className="space-y-8">
      <h1 className="text-3xl font-bold text-gray-800 dark:text-white">Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <Card className="border-l-4 border-blue-500">
          <h2 className="text-sm font-medium text-gray-500 truncate">Total Balance</h2>
          <p className="mt-1 text-3xl font-semibold text-gray-900 dark:text-white">${totalBalance.toFixed(2)}</p>
        </Card>
        <Card className="border-l-4 border-green-500">
          <h2 className="text-sm font-medium text-gray-500 truncate">Total Income</h2>
          <p className="mt-1 text-3xl font-semibold text-green-600">${summary.totalIncome.toFixed(2)}</p>
        </Card>
        <Card className="border-l-4 border-red-500">
          <h2 className="text-sm font-medium text-gray-500 truncate">Total Expenses</h2>
          <p className="mt-1 text-3xl font-semibold text-red-600">${summary.totalExpenses.toFixed(2)}</p>
        </Card>
        <Card className="border-l-4 border-purple-500">
          <h2 className="text-sm font-medium text-gray-500 truncate">Total Savings</h2>
          <p className="mt-1 text-3xl font-semibold text-purple-600">${summary.totalSavings.toFixed(2)}</p>
        </Card>
      </div>

      <Card>
        <h2 className="text-lg font-medium text-gray-900 dark:text-white mb-4">Monthly Income vs. Expense</h2>
        <div className="h-72">
          <Line data={chartData} options={{ responsive: true, maintainAspectRatio: false }} />
        </div>
      </Card>

      {/* Placeholder for recent transactions or other widgets */}
    </div>
  );
};

export default DashboardPage;
